export default function PokemonList({ currents, news }){
    //console.log(currents);
    for (let i in currents) {
        console.log(currents[i]);  
    }
    return(
        <div>
            
            {currents?.map((value, index) => (
                <div key={index}>
                    <p>{value.name}</p>
                </div>
            ))}
        </div>
    );
}
